class Solution(object):
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        import copy
        s_words = set(words)
        if len(words) == 0 or len(words[0]) == 0:
            return []

        res = []
        len_word = len(words[0])
        len_words = len(words)
        need_arr = [copy.deepcopy(words) for _ in range(len_word)]
        pass_arr = [[] for _ in range(len_word)]
        for i in range(len(s) - len_word + 1):
            j = i % len_word
            cur_word = s[i:i+len_word]
            if cur_word in s_words:
                if cur_word in need_arr[j]:
                    pass_arr[j].append(cur_word)
                    need_arr[j].remove(cur_word)
                    if len(pass_arr[j]) == len_words:
                        res.append(i - len_word * len_words + len_word)
                        need_arr[j].append(pass_arr[j][0])
                        pass_arr[j].pop(0)
                else:
                    pass_arr[j].append(cur_word)
                    while len(pass_arr[j]) > 0:
                        pop_word = pass_arr[j].pop(0)
                        if pop_word == cur_word:
                            break
                        need_arr[j].append(pop_word)
            else:
                pass_arr[j] = []
                need_arr[j] = copy.deepcopy(words)
        return res


